INSERT INTO public.destinationfinal (id, description, image, lat, lng, nom) VALUES (29, 'L’avenue des Champs-Élysées est une grande et célèbre voie de Paris. Elle est considérée par beaucoup comme la plus belle avenue de la capitale, et, selon une expression couramment utilisée en France, comme la plus belle avenue du monde.', '', 48.8695, 2.3082, 'Champs Élysées');
INSERT INTO public.destinationfinal (id, description, image, lat, lng, nom) VALUES (35, 'Arcachon est une commune du Sud-Ouest de la France, sous-préfecture du département de la Gironde, en région Nouvelle-Aquitaine. Elle a été créée en 1857 par séparation d''une partie de la commune de La Teste-de-Buch.', '', 44.65, -1.1667, 'Arcachon');